    "mapbook",nt"isopen": true,nt"url": null,nt"notes": "Beginning with
    the systematic mapping of the lunar surface more than three decades ago, this database
    contains over 1600 maps of the planets and satellites of the Solar System. This
    collection of maps is a unique resource that has been derived from images and data
    returned by a series of space missions. Many of the maps have not been replicated
    or updated with data from new missions, and thus they represent a very special legacy
    from the beginnings of space exploration. The total map database includes controlled
    photomosaics, geologic maps, shaded relief portrayals, topographic maps, and panoramas
    of the martian surface.",nt"license_title": "U.S. Government Work",nt"extras":
